import React from "react";
const MealItem = props => {
    const List = [
        ...props.DUMMY_MEALS
    ]
    const ListItem = List.map(meals=><li>{meals.name}</li>);
    const Price = `$${props.price.toFixed(2)}`;
    return (

        <ul>
            <li>
                <div>
                    <h3>{props.name}</h3>
                    <div>{props.description}</div>
                    <div>{Price}</div>
                </div>
                <div></div>
            </li>
        </ul>
    );
}
export default MealItem;
